import React from 'react';
import '../App.css';
import { Link } from "react-router-dom";
import Login from "../components/Login";


const baba = fetch('/ping');//want to display this on page just as a test that client is connected to server, it seems to be though

function onClick1(){
	this.setState({
		text: baba
	});
}

function Home() {
	return(
		<header className="App-header">
			<img src="images/Nooth_DnD.png" className="App-logo" alt="logo" />
			<h1 className="title">
				DnD20
			</h1>
			<Login />
			<button name="showpong" onClick={onClick1}>
				click me!
			</button>
			<button name="next" variant="outlined">
				<Link to="/SomePage">
					Go to Some Page
				</Link>
			</button>
		</header>
		)
}

export default Home;
